    /* access modifiers changed from: private */
    public void getPairedDevice() {
        BluetoothPairedDeviceDialog printerDialogFragment = new BluetoothPairedDeviceDialog();
        printerDialogFragment.setStyle(DialogFragment.STYLE_NORMAL, R.style.MyDialogFragmentTheme);
        printerDialogFragment.show(getSupportFragmentManager(), "Reschedule_dialog_fragment");
        printerDialogFragment.setCancelable(false);
        printerDialogFragment.setCallBack(new BluetoothPairedDeviceDialog.pairedDevice() {
            public void onBluetootPairedDevicetReturned(BluetoothDevice device, Dialog dialog) {
                if (device != null && dialog != null) {
                    try {
                        MainActivity.this.findBT(device, dialog);
                        MainActivity.this.openBT(dialog);
                    } catch (IOException ex) {
                        ex.printStackTrace();
                    }
                }
            }
        });
    }

    /* access modifiers changed from: private */
    public void findBT(BluetoothDevice device, Dialog dialog) {
        try {
            this.myLabel.setText("Searching..");
            BluetoothAdapter defaultAdapter = BluetoothAdapter.getDefaultAdapter();
            this.mBluetoothAdapter = defaultAdapter;
            if (defaultAdapter == null) {
                this.myLabel.setText("No bluetooth adapter available");
            }
            if (!this.mBluetoothAdapter.isEnabled()) {
                this.myLabel.setText("No bluetooth adapter available");
                return;
            }
            if (device != null) {
                this.mmDevice = device;
            }
            this.myLabel.setText("Bluetooth device found.");
            dialog.dismiss();
        } catch (Exception e) {
            e.printStackTrace();
        }
    }

    /* access modifiers changed from: package-private */
    public void openBT(Dialog dialog) throws IOException {
        try {
            this.myLabel.setText("Bluetooth connecting progress..");
            BluetoothSocket createRfcommSocketToServiceRecord = this.mmDevice.createRfcommSocketToServiceRecord(UUID.fromString("00001101-0000-1000-8000-00805F9B34FB"));
            this.mmSocket = createRfcommSocketToServiceRecord;
            try {
                createRfcommSocketToServiceRecord.connect();
                this.mmOutputStream = this.mmSocket.getOutputStream();
                this.mmInputStream = this.mmSocket.getInputStream();
                beginListenForData();
                this.myLabel.setText("Bluetooth Opened");
                dialog.dismiss();
            } catch (Exception e) {
                this.myLabel.setText(e.toString());
                dialog.dismiss();
            }
        } catch (Exception e2) {
            e2.printStackTrace();
            dialog.dismiss();
        }
    }

    /* access modifiers changed from: package-private */
    public void beginListenForData() {
        try {
            final Handler handler = new Handler();
            this.stopWorker = false;
            this.readBufferPosition = 0;
            this.readBuffer = new byte[1024];
            Thread thread = new Thread(new Runnable() {
                public void run() {
                    while (!Thread.currentThread().isInterrupted() && !MainActivity.this.stopWorker) {
                        try {
                            int bytesAvailable = MainActivity.this.mmInputStream.available();
                            if (bytesAvailable > 0) {
                                byte[] packetBytes = new byte[bytesAvailable];
                                MainActivity.this.mmInputStream.read(packetBytes);
                                for (int i = 0; i < bytesAvailable; i++) {
                                    byte b = packetBytes[i];
                                    if (b == 10) {
                                        byte[] encodedBytes = new byte[MainActivity.this.readBufferPosition];
                                        System.arraycopy(MainActivity.this.readBuffer, 0, encodedBytes, 0, encodedBytes.length);
                                        final String data = new String(encodedBytes, "US-ASCII");
                                        MainActivity.this.readBufferPosition = 0;
                                        handler.post(new Runnable() {
                                            public void run() {
                                                MainActivity.this.myLabel.setText(data);
                                            }
                                        });
                                    } else {
                                        byte[] bArr = MainActivity.this.readBuffer;
                                        MainActivity mainActivity = MainActivity.this;
                                        int i2 = mainActivity.readBufferPosition;
                                        mainActivity.readBufferPosition = i2 + 1;
                                        bArr[i2] = b;
                                    }
                                }
                            }
                        } catch (IOException e) {
                            MainActivity.this.stopWorker = true;
                        }
                    }
                }
            });
            this.workerThread = thread;
            thread.start();
        } catch (Exception e) {
            e.printStackTrace();
        }
    }

    /* access modifiers changed from: package-private */
    public void sendData() throws IOException {
        try {
            String msg = this.myTextbox.getText().toString().replace("\r\n", "\n").replace("\n", "\r\n") + "\r\n";
            OutputStream outputStream = this.mmOutputStream;
            if (outputStream == null) {
                this.myLabel.setText("Data sent failed..");
                return;
            }
            try {
                outputStream.write(msg.getBytes("ISO-8859-1"));
                this.myLabel.setText("Data sent.");
            } catch (Exception e) {
                this.myLabel.setText("Data sent failed..");
            }
        } catch (Exception e2) {
            e2.printStackTrace();
        }
    }

    /* access modifiers changed from: package-private */
    public void closeBT() throws IOException {
        try {
            this.stopWorker = true;
            this.mmOutputStream.close();
            this.mmInputStream.close();
            this.mmSocket.close();
            this.myLabel.setText("Bluetooth Closed");
        } catch (Exception e) {
            e.printStackTrace();
        }
    }

